In the example below, we define a simple async function in javascript, and call it from rust. The runtime's own tokio runtime is used to resolve the future. The event loop, and the implicit promise resolution, is handled by the runtime, transparently. This is the simplest way to use async functions. use rustyscript::{Error, Module, Runtime}; fn main() -> Result<(), Error> { let module = Module::new( "test.js", " export const my_func = async () => 42; ", ); // Create a new runtime // We don't need to create a tokio runtime, as the runtime will create one for us let mut runtime = Runtime::new(Default::default())?; let handle = runtime.load_module(&module)?; let tokio_runtime = runtime.tokio_runtime(); // Call the function, and await the result let value: u32 = tokio_runtime.block_on(async { runtime .call_function_async(Some(&handle), "my_func", &()) .await })?; assert_eq!(value, 42); Ok(())
} Another way is with js_value::Promise Normally, calling a function would resolve the promise. So we need to use call_function_immediate instead. use rustyscript::{js_value::Promise, Error, Module, Runtime}; fn main() -> Result<(), Error> { let module = Module::new( "test.js", " export const my_func = async () => 42; ", ); // Create a new runtime let mut runtime = Runtime::new(Default::default())?; let handle = runtime.load_module(&module)?; // Call the function, and get the promise let promise: Promise<u32> = runtime.call_function_immediate(Some(&handle), "my_func", &())?; // Resolve the promise // You could instead call `into_future` here, and await it, for a non-blocking version let value = promise.into_value(&mut runtime)?; assert_eq!(value, 42); Ok(())
}

