Op2 is a deno-provided macro that allows you to define an extension function. The supported types for arguments can be found listed in https://github.com/denoland/deno_core/blob/main/ops/op2/valid_args.md And return types, here: https://github.com/denoland/deno_core/blob/main/ops/op2/valid_retvals.md The fast attribute used when possible to denote that the types involved can be converted fast. Don't stress too much on when to use this, as the compiler will tell you if you need it, or do not. Ops defined in an extension can then be called from javascript using Deno.core.ops.op_name(args...). Async functions can be defined as well. Let us break down a more complex example taken from rustyscript's own internals: #[op2(async)]
#[serde]
fn call_registered_function_async( #[string] name: String, #[serde] args: Vec<serde_json::Value>, state: &mut OpState,
) -> impl std::future::Future<Output = Result<serde_json::Value, Error>> { if state.has::<AsyncFnCache>() { let table = state.borrow_mut::<AsyncFnCache>(); if let Some(callback) = table.get(&name) { return callback(args); } } Box::pin(std::future::ready(Err(Error::ValueNotCallable(name))))
} #[op2(async)] is used to denote that this is an async function - it must return a Future of some kind Potential pitfall: the returned future cannot have a lifetime #[serde] means that the return value will be a type decoded with serde::Deserialize. In this fase, there return value is Future<Output = Result<serde_json::Value, Error>> - A future that resolves to a serde_json::Value, or an error. The arguments are annotated with #[string] and #[serde] to denote that they are a string, and a deserializable type, respectively. The state argument is a special case that can be used for persistent storage inside of ops. In this case, it is used to store a cache. And finally, the returned future is run through Box::pin before being returned. You can also customize the names of your extension modules If you instead define the extension as follows: extension!( example_extension, ops = [op_add_example], esm_entry_point = "example:calculator", esm = [ dir "examples/example_extension", "example:calculator" = "example_extension.js" ],
); Then provide a schema whitelist in your RuntimeOptions: let mut schema_whlist = HashSet::new(); schema_whlist.insert("example:".to_string()); options.schema_whlist = schema_whlist; You would be able to import { add } from "example:calculator"; from inside of your js modules.

