}); fn main() -> Result<(), Error> { MY_DEFAULT_RUNTIME::with(|runtime| { runtime.eval::<()>("console.log('Hello, World!')") })
} Under the hood, a static runtime is effectively: thread_local! { static MY_RUNTIME: OnceCell<RefCell<Result<Runtime, Error>>>;
} Which provides thread safety, static initialization, interior mutability, and initializer error handling. Note: While it is possible to initialize a StaticRuntime object directly, it is not recommended, as it bypasses the thread_local safety layer.

