Many of the extension features allow for custom permissions to be set. This allows for a more fine-grained control over what can be accessed. This can be done by specifying a value for the permissions: Arc<dyn WebPermissions>, field in RuntimeOptions::web. The default value is DefaultWebPermissions, which simply allows everything. AllowlistWebPermissionsSet is also built-in, and allows for specific permissions to be turned on or off: use rustyscript::{AllowlistWebPermissions, Error, Runtime, RuntimeOptions};
use std::sync::Arc; fn main() -> Result<(), Error> { let permissions = Arc::new(AllowlistWebPermissions::default()); let mut options = RuntimeOptions::default(); options.extension_options.web.permissions = permissions.clone(); let mut runtime = Runtime::new(options)?; // Fetching any URL will fail let result = runtime.eval::<()>("fetch('https://example.com')"); assert!(result.is_err()); // But if we allow it: permissions.allow_url("https://example.com"); let result = runtime.eval::<()>("fetch('https://example.com')"); assert!(result.is_ok()); Ok(())
} You can also implement the WebPermissions trait yourself, and use that instead for even more precise control.

